import React from "react";

import logo from "../images/sacem-logo.png";

const NewNav = () => {
  return (
    <header
      style={{
        position: "sticky",
        top: 0,
        backgroundColor: "rgba(255, 255, 255, 0.9)",
      }}
    >
      <div
        className="navmenu"
        style={{
          display: "flex",
          justifyContent: "space-around",
          padding: "15px",
          alignItems: "center",
        }}
      >
        <img
          src="logo-default-group-en.svg"
          alt="logo-default"
          style={{
            width: "190px",
            height: "90px",
            marginLeft: "30px",
            paddingBottom: "20px",
          }}
        />
        <nav
          className="navbar"
          style={{
            display: "flex",
            justifyContent: "space-between",
            width: "15%",
            listStyle: "none",
            alignItems: "center",
            marginRight: "66px",
          }}
        >
          <a
            className="navmenu_a_colored"
            href=""
            style={{ color: "#16baa4", textDecoration: "none" }}
          >
            About us
          </a>
          <a
            className="a_hover"
            href=""
            style={{ color: "#16baa4", textDecoration: "none" }}
          >
            Career
          </a>
          <a
            className="a_hover"
            href=""
            style={{ color: "#16baa4", textDecoration: "none" }}
          >
            Departments
          </a>
        </nav>
      </div>
    </header>
  );
};

export default NewNav;
